[obfuscator]

enabled=true
export_vars=true
shuffle_top_level=true
inline_consts=true
inline_enums=true
preprocessor_prefix="##"

[post_process]

strip_comments=true
strip_empty_lines=true
strip_extraneous_spacing=true
regex_filter_enabled=true
regex_filter=""
feature_filters=true
export_mode=0

[id]

prefix="__"
character_list="abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789_"
target_length=4
seed=6000213
dynamic_seed=false

[source_mapping]

filepath="res://addons/gdmaim/source_maps"
max_files=10
compress=true
inject_name=true
